import React from 'react';


const Users = (props) => {

    let usersComponent = props.users.map((user) => {
        return <div key={user.id}>
            <span>
                <div>
                    <img src={user.photoUrl} />
                </div>
                <div>
                {user.followed ? <button onClick = {() => props.follow(user.id)}>Follow</button> : <button onClick = {() => props.unfollow(user.id)}>Follow</button>}
                    
                </div>
            </span>
            <span>
                <div>{user.name}</div>
                <div>{user.status}</div>
                <div>{user.location}</div>
            </span>
        </div>
    });

    return <div>
        {usersComponent}
    </div>
}

export default Users;
